import React, { useState } from "react";
import './Navbar.css';
import logo from '../Assets/logo.png';    // Change the Project Logo
import cart_icon from '../Assets/cart_icon.png';


const Navbar = () => {

    const [menu,setMenu] = useState("shop");

  return (
    <div className="navbar">
        <div className="nav-logo">
            {/* Add the Project Logo here */}
            <img src={logo} alt=""/>  
        <p>Agriculter Portal</p>

        </div>
        <ul className="nav-menu">
            <li onClick={() => {setMenu("shop")}}>Shop{menu === "shop"?<hr/>:<></>}</li>
            <li onClick={() => {setMenu("Fatilizer")}}>Fatilizer{menu === "Fatilizer"?<hr/>:<></>}</li>
            <li onClick={() => {setMenu("Vegetables")}}>Vegetables{menu === "Vegetables"?<hr/>:<></>}</li>
            <li onClick={() => {setMenu("Fruits")}}>Fruits{menu === "Fruits"?<hr/>:<></>}</li>
        </ul>
        <div className="nav-login-cart">
            <button>Login</button>
            <img src={cart_icon} alt=""/>
            <div className="nav-cart-count">0</div>
        </div>
    </div>

  )
}

export default Navbar
